import React from 'react'
import cl from './ContentMicrodata.module.css'

const ContentMicrodata = () => {
    return <div className={cl.microdataContainer}>
        <h2 className={cl.microdataHead}>Устранение неполадок с сетью в Windows</h2>
    </div>
}

export default ContentMicrodata;
